  | RPAREN  -> 1 
  | LPAREN  -> 2 
  | UMINUS  -> 3 
  | DIVIDE  -> 4 
  | TIMES  -> 5 
  | MINUS  -> 6 
  | PLUS  -> 7 
  | NUMERAL _ -> 8 

// This function maps integer indexes to symbolic token ids
